struct P{ int w,h,x,y; bool f; };

int main(){
  int n, ans;
  int a[5][5];
  stack<P> st;
  P p;
  bool f;

  cin >> n;
  for( int loop=0;loop<n;loop++ ){
    while( !st.empty() ) st.pop();

    for( int i=0;i<5;i++ )
      for( int j=0;j<5;j++ )
	cin >> a[i][j];

    p.w=1; p.h=1; p.f=true;
    for( int i=0; i<5; i++ ){
      for( int j=0;j<5;j++ ){
	if( a[i][j]==1 ){
	  p.x=i; p.y=j;
	  st.push( p ); p.f=!p.f; st.push( p );
	}
	if( DEBUG ) cout << a[i][j] << " ";
      }
      if( DEBUG ) cout << endl;
    }
    ans=1;
    while( !st.empty() ){
      p = st.top(); st.pop();
      f = false;
      if( p.f ){ // ツ可。ツ陛サツ古シ
	if( p.x+p.w<5 ){
	  for( int i=0;i<p.h;i++ ){
	    if( a[p.x+p.w][p.y+i]==0 ) break;
	    if( i==p.h-1 ) f=true;
	  }
	  if( f ) p.w++;
	}
      }else{ // ツ縦ツ陛サツ古シ
	if( p.y+p.h<5 ){
	  for( int i=0;i<p.w;i++ ){
	    if( a[p.x+i][p.y+p.h]==0 ) break;
	    if( i==p.w-1 ) f=true;
	  }
	  if( f ) p.h++;
	}
      }
      if( f ){
	int area = p.w*p.h;
	if( area> ans ){  ans = area;	}
	st.push( p ); p.f=!p.f; st.push( p );
      }
    }
    cout << ans << endl;
  }

  return 0;
}

