int
main ( )
{
  int n;
  int i, j;

  scanf ( "%d", &n );
  while ( n-- )
  {
    int d[ N ][ N + 1 ] = { };
    int res = 0;

    for ( i = 0; i < N; ++i )
    for ( j = 0; j < N; ++j )
    {
      scanf ( "%d", &d[ i ][ j ] );
    }

    for ( i = 1; i < N; ++i )
    for ( j = 0; j < N; ++j )
    {
      if ( d[ i ][ j ] )
      {
        d[ i ][ j ] += d[ i - 1 ][ j ];
      }
    }

    for ( i = 0; i < N; ++i )
    {
      int s[ N + 1 ], sp = 0;

      for ( j = 0; j <= N; ++j )
      {
        while ( sp && d[ i ][ j ] < d[ i ][ s[ sp - 1 ] ] )
        {
          --sp;
          res = max ( res, ( j - s[ sp ] ) * d[ i ][ s[ sp ] ] );
        }
        s[ sp++ ] = j;
      }
    }

    printf ( "%d\n", res );
  }

  return ( 0 );
}

