using namespace std;

struct Info{
	Info(){ left = height = 0;}
	Info(int arg_left,int arg_height){
		left = arg_left;
		height = arg_height;
	}
	int left,height;
};

int main(){

	int n,max_s,tmp,tmp_h,table[6][6];

	stack<Info> S;
	Info work;

	scanf("%d",&n);

	for(int loop = 0; loop < n; loop++){

		for(int i = 0; i < 6; i++)table[0][i] = 0;
		for(int i = 0; i < 6; i++)table[i][5] = 0;

		max_s = 0;

		for(int i = 1; i <= 5; i++){

			for(int k = 0; k < 5; k++){
				scanf("%d",&table[i][k]);
				if(table[i][k] == 1){
					table[i][k] = table[i-1][k]+1;
				}
			}

			getchar();

			tmp_h = table[i][0];
			S.push(Info(0,tmp_h));

			for(int k = 1; k < 6; k++){
				if(table[i][k] > tmp_h){
					S.push(Info(k,table[i][k]));
					tmp_h = table[i][k];
				}else if(table[i][k] == tmp_h){
					//Do nothing
				}else{
					while(S.empty() == false && S.top().height >= table[i][k]){
						work = S.top();
						S.pop();
						tmp = (k - work.left)*work.height;
						max_s = (max_s >= tmp)?max_s:tmp;
					}
					tmp_h = table[i][k];
					S.push(Info(work.left,table[i][k]));
				}
			}
		}
		while(!S.empty())S.pop();
		printf("%d\n",max_s);
	}

	return 0;
}

