                        // if(ans < tall*(j-stk.back().first)) {
                        //     printf("%d %d %d\n", i, j, tall*(j-stk.back().first));
                        // }
                        ans = max(tall*(j-stk.back().first),ans);
                        stk.pop_back();
                    }
                }
            }

            while(!stk.empty()) {
                // if(ans < stk.back().second*(4-stk.back().first)) {
                //     printf("%d %d %d\n", i, 4, stk.back().second*(4-stk.back().first));
