int calS(int field[5][5],int si,int sj){
	int max = 0;

	for(int width=5-sj;width>0;width--){
		int S = 0;
		bool flg = true;

		for(int i=si;flg && i<5;i++){
			for(int j=sj;j<sj+width;j++){
				if(field[i][j] == 0){
					flg = false;
					break;
				}
			}
			if(flg) S += width;
			else break;
		}

		if(max < S) max = S;
	}

	return max;
}

