namespace solution {
    using namespace std;

    typedef istringstream ISS;
    typedef ostringstream OSS;
    typedef vector<string> VS;
    typedef long long LL;
    typedef int INT;
    typedef vector<INT> VI;
    typedef vector<VI> VVI;
    typedef pair<INT, INT> II;

    const int SIZE = 5;
    bool T[SIZE][SIZE];
    int L[SIZE][SIZE];

    class Solution {
    private:
        void init() {
        }

        bool input() {
            for ( int i = 0; i < SIZE; ++ i ) {
                for ( int j = 0; j < SIZE; ++ j ) {
                    int t;
                    cin >> t;
                    T[i][j] = t;
                }
            }
            return true;
        }

        int solve() {
            for ( int i = 0; i < SIZE; ++ i ) {
                for ( int j = 0; j < SIZE; ++ j ) {
                    L[i][j] = T[i][j];
                }
            }
            for ( int i = 0; i < SIZE; ++ i ) {
                int cnt = 0;
                for ( int j = SIZE - 1; j >= 0; -- j ) {
                    if ( T[i][j] ) {
                        cnt ++;
                    } else {
                        cnt = 0;
                    }
                    L[i][j] = cnt;
                }
            }
            int res = 0;
            for ( int i = 0; i < SIZE; ++ i ) {
                for ( int j = 0; j < SIZE; ++ j ) {
                    if ( L[i][j] == 0 ) continue;
                    int min_l = L[i][j];
                    for ( int k = 0; k < SIZE; ++ k ) {
                        int r = i + k;
                        if ( r >= SIZE ) break;
                        int c = j;
                        min_l = min( min_l, L[r][c] );
                        res = max( res, min_l * ( k + 1 ) );
                    }
                }
            }
            return res;
        }

    public:
        int run() {
            int tests;
            cin >> tests;
            for ( int i = 0; i < tests; ++ i ) {
                input();
                cout << solve() << endl;
            }
            return 0;
        }
    };
}

int main() {
    using namespace solution;
    Solution s;
    return s.run();
}

