using namespace std;
int dp[6][6];
int H = 5, W = 5;
int buffer[6][6], T[6][6];

struct Rectangle {int height, pos; };

int getLargestRectangle(int row) {
    stack<Rectangle> S;
    int maxv = 0;
    T[row][W] = 0;

    Rectangle rect, pre;
    int target, area;
    for (int i = 0; i <= W; i++) {
        rect.height = T[row][i];
        rect.pos = i;
        if (S.empty()) S.push(rect);
        else {
            if (S.top().height < rect.height) S.push(rect);
            else {
                target = i;
                while (!S.empty() && S.top().height >= rect.height) {
                    pre = S.top(); S.pop();
                    area = pre.height * (i - pre.pos);
                    maxv = max(maxv, area);
                    target = pre.pos;
                }
                rect.pos = target;
                S.push(rect);
            }
        }
    }
    return maxv;
}

void solve() {
    for (int j = 0; j < W; j++) {
        for (int i = 0; i < H; i++) {
            if (buffer[i][j]) T[i][j] = 0;
            else T[i][j] = (i > 0) ? T[i-1][j]+1 : 1;
        }
    }
    int maxv = 0;
    for (int i = 0; i < H; i++) maxv = max(maxv, getLargestRectangle(i));
    printf("%d\n", maxv);
}



int main()
{

    int n, t;
    scanf("%d", &n);
    for (int i = 0; i < n; i++) {
        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                scanf("%d", &t);
                buffer[i][j] = (t+1) %2;
            }
        }
        solve();
    }

    return 0;
}

