			for(int u = 0; u < SIZE; ++u) {
				for(int d = u + 1; d <= SIZE; ++d) {
					if(ok(l, r, u, d)) chmax(ans, (r - l) * (d - u));
				}
			}
		}
	}

	return ans;
}

