        				stack.push(sum[i][j]);
        				number.push(j);
        			}else{
        				int num = j;

        				while(!stack.isEmpty() && stack.peek() > sum[i][j]){
        					final int high = stack.pop();
        					final int place = number.pop();

        					num = Math.min(num, place);

        					final int dist = j - place;

        					//System.out.println("<" + dist + " " + high + ">");

